(function execute(inputs, outputs) {
   var gfs = new GoogleCloudFunctionsUtils();
    gfs.validateInputVariables(inputs, outputs);
    gfs.validateMandatoryVariables(inputs, ['projectid', 'location']);
    gfs.maptoOutputFromInput(inputs, outputs, ['projectid', 'location']);
    gfs.createFunctionHttp(inputs,outputs);
})(inputs, outputs);

